import NavBar from "./navBar"

function Instructions() {

  return (  
    <div className="mainContainer">
        <NavBar />

        <div>
          <p>New User?</p>

          <div>
            <p>Click the "Register" button on the top right of the screen, as shown on the right.</p>
          </div>

          <div>
            <p>On the registration screen, fill in all the fields, then click "Register" to create your account.</p>
          </div>
        </div>

    </div>
  );
}

export default Instructions;
